import React, { useState, useEffect } from "react";
import Parse from "parse";
// import Parse from "parse/dist/parse.min.js";
import ChatSetup from "../../api/ChatSetup";

export default function ChatList(props) {
  const [localUsers, setLocalUsers] = useState([]);
  const [currentUserName, setCurrentUserName] = useState("");
  props.setCurrentUser(Parse.User.current());

  useEffect(() => {
    setCurrentUserName(props.currentUser.get("username"));
    queryAllUsers().then((result) => setLocalUsers(result));
  }, []);

  async function queryAllUsers() {
    try {
      const queryUsers = new Parse.Query("User");
      queryUsers.notEqualTo("username", currentUserName);
      const allUserObjects = await queryUsers.find();
      // const result = allUserObjects.map(
      //   (userobject) => (userobject = userobject.get("username"))
      // );
      return allUserObjects;
    } catch (error) {
      console.log(error);
    }
  }
  console.log("Current user: ", currentUserName);
  console.log("localUsers: ", localUsers);

  const listNames = localUsers.map(
    (username, i) =>
      (username = (
        <li>
          <ChatSetup
            key={i}
            currentUser={props.currentUser}
            selectedUser={props.selectedUser}
            setSelectedUser={props.setSelectedUser}
          />
        </li>
      ))
  );

  return <ul>{listNames}</ul>;
}
